INSERT INTO AppointmentEntity (
    id,
    start_date_time,
    duration_in_seconds,
    appointment_status,
    location,
    previous_appointment_id,
    patient_full_name,
    patient_email,
    patient_phone_number,
    patient_reason,
    clinician_notes,
    is_acknowledged,
    created_at,
    updated_at
) VALUES
(1, '2025-11-02 09:00:00', 1800, 'REQUESTED', '', NULL, 'Tyrannosaurus Rex', 'trex@jurassicperiod.com', '1000000010', 'Complains of severe jaw pain and tension from decades of roaring at smaller dinosaurs. Mentions that the echo from his own growl reverberates painfully inside his massive skull, and suspects long-term hearing fatigue from prehistoric thunderclaps.', '', false, '2025-11-01 09:00:00', '2025-11-01 09:00:00'),
(2, '2025-11-02 09:30:00', 1800, 'REQUESTED', '', NULL, 'Velociraptor', 'velociraptor@cretaceous.co', '1000000011', 'Reports persistent ear ringing and high-frequency sensitivity following countless pack hunts. Notes that the constant shrieking of companions has caused what she calls “predatory tinnitus,” affecting her stealth and social interactions.', '', false, '2025-11-01 09:05:00', '2025-11-01 09:05:00'),
(3, '2025-11-02 10:00:00', 1800, 'REQUESTED', '', NULL, 'Triceratops', 'triceratops@jurassicmail.com', '1000000012', 'Experiencing chronic headaches and dull auditory perception after repeated horn clashes with rivals. Suspects vibrations from head-on collisions have compromised his inner ear balance, making it difficult to detect sneaky predators like raptors.', '', false, '2025-11-01 09:10:00', '2025-11-01 09:10:00'),
(4, '2025-11-02 10:30:00', 1800, 'REQUESTED', '', NULL, 'Stegosaurus', 'stegosaurus@jurassicmail.com', '1000000013', 'Complains that constant tail-swinging to ward off predators creates low-frequency vibrations that travel up his spine, resulting in auditory distortion. Fears his large plates may amplify environmental sounds beyond tolerable limits.', '', false, '2025-11-01 09:15:00', '2025-11-01 09:15:00'),
(5, '2025-11-02 11:00:00', 1800, 'REQUESTED', '', NULL, 'Brachiosaurus', 'brachiosaurus@highreach.org', '1000000014', 'Reports difficulty hearing treetop rustling due to immense neck length and altitude-induced pressure imbalance. Expresses frustration at having to bend down several meters to confirm if someone is even speaking to him.', '', false, '2025-11-01 09:20:00', '2025-11-01 09:20:00'),
(6, '2025-11-02 11:30:00', 1800, 'REQUESTED', '', NULL, 'Ankylosaurus', 'ankylosaurus@armoredmail.net', '1000000015', 'Complains of muffled sound perception possibly due to his heavily armored skull. Notes that while this armor protects from predators, it also traps vibrations, making it difficult to distinguish between distant footsteps and internal echoes.', '', false, '2025-11-01 09:25:00', '2025-11-01 09:25:00'),
(7, '2025-11-02 12:00:00', 1800, 'REQUESTED', '', NULL, 'Pteranodon', 'pteranodon@skyflier.com', '1000000016', 'Experiencing intense wind noise damage from high-altitude flights. Complains that air rushing past his crest generates constant whistling, disrupting communication during migration and possibly causing irreversible hearing degradation.', '', false, '2025-11-01 09:30:00', '2025-11-01 09:30:00'),
(8, '2025-11-02 12:30:00', 1800, 'REQUESTED', '', NULL, 'Spinosaurus', 'spinosaurus@riversaur.net', '1000000017', 'Reports recurring discomfort in ear canals due to prolonged exposure to swamp and river environments. Claims that splashing fish and gurgling water interfere with his natural sonar instincts, making prey detection frustratingly unreliable.', '', false, '2025-11-01 09:35:00', '2025-11-01 09:35:00'),
(9, '2025-11-02 13:00:00', 1800, 'REQUESTED', '', NULL, 'Allosaurus', 'allosaurus@huntermail.com', '1000000018', 'Complains that his hunting calls echo too effectively in canyons, creating auditory confusion. States that every roar feels like an earthquake inside his head and fears his sense of hearing may be worsening due to excessive territorial disputes.', '', false, '2025-11-01 09:40:00', '2025-11-01 09:40:00'),
(10, '2025-11-02 13:30:00', 1800, 'REQUESTED', '', NULL, 'Parasaurolophus', 'parasaur@resonance.org', '1000000019', 'Reports dizziness and discomfort from his own resonating crest, which amplifies vocal sounds to unnatural levels. Claims he can hear his own calls reverberate several seconds later, creating a feedback loop that disrupts herd communication.', '', false, '2025-11-01 09:45:00', '2025-11-01 09:45:00'),
(11, '2025-11-02 14:00:00', 1800, 'REQUESTED', '', NULL, 'Iguanodon', 'iguanodon@herbivore.net', '1000000020', 'Complains of subtle auditory distortion caused by constant chewing of fibrous plants. Claims grinding noises from massive jaws make it hard to hear nearby predators, resulting in heightened anxiety and occasional false alarms among herd mates.', '', false, '2025-11-01 09:50:00', '2025-11-01 09:50:00'),
(12, '2025-11-02 14:30:00', 1800, 'REQUESTED', '', NULL, 'Dilophosaurus', 'dilophosaurus@venomspit.io', '1000000021', 'Mentions difficulty maintaining sound focus after years of spitting venom accompanied by high-pitched shrieks. The combination of fluid pressure and noise has allegedly damaged her eardrums, leaving her hypersensitive to splashing sounds.', '', false, '2025-11-01 09:55:00', '2025-11-01 09:55:00'),
(13, '2025-11-02 15:00:00', 1800, 'REQUESTED', '', NULL, 'Compsognathus', 'compsognathus@tinyhunters.io', '1000000022', 'Describes auditory overstimulation from living in densely packed scavenger groups. Notes that constant chatter among peers causes headaches and ringing in ears, making it impossible to rest without curling up in silence under ferns.', '', false, '2025-11-01 10:00:00', '2025-11-01 10:00:00'),
(14, '2025-11-02 15:30:00', 1800, 'REQUESTED', '', NULL, 'Carnotaurus', 'carnotaurus@hornmail.org', '1000000023', 'Reports a vibrating hum in the skull whenever roaring or headbutting prey. Claims horns may act as acoustic amplifiers, turning normal sounds into deafening booms. Requests consultation for “anger management or noise dampening strategies.”', '', false, '2025-11-01 10:05:00', '2025-11-01 10:05:00'),
(15, '2025-11-02 16:00:00', 1800, 'REQUESTED', '', NULL, 'Gallimimus', 'gallimimus@speedy.net', '1000000024', 'Complains of chronic wind-induced ear pain caused by sprinting at extreme speeds. Says whistling air across ear openings produces relentless noise that keeps echoing long after stopping, affecting sleep and social communication.', '', false, '2025-11-01 10:10:00', '2025-11-01 10:10:00'),
(16, '2025-11-02 16:30:00', 1800, 'REQUESTED', '', NULL, 'Pachycephalosaurus', 'pachy@hardhead.com', '1000000025', 'Notes that repeated head-butting contests have resulted in persistent internal ringing and momentary deafness. Worries that concussive pressure waves traveling through his dome skull have permanently dulled his perception of predator calls.', '', false, '2025-11-01 10:15:00', '2025-11-01 10:15:00'),
(17, '2025-11-02 17:00:00', 1800, 'REQUESTED', '', NULL, 'Archaeopteryx', 'archaeopteryx@wingmail.org', '1000000026', 'Mentions imbalance between aerial chirping and land communication after evolving primitive flight abilities. Notes that ear feathers muffle high-pitched calls, leading to miscommunication during flock navigation.', '', false, '2025-11-01 10:20:00', '2025-11-01 10:20:00'),
(18, '2025-11-02 17:30:00', 1800, 'REQUESTED', '', NULL, 'Therizinosaurus', 'therizinosaurus@clawmail.net', '1000000027', 'Reports faint ringing possibly caused by repeated scraping of enormous claws against bark. Claims metallic resonance travels up his forelimbs into his head, creating bizarre auditory sensations that disrupt normal feeding behavior.', '', false, '2025-11-01 10:25:00', '2025-11-01 10:25:00'),
(19, '2025-11-02 18:00:00', 1800, 'REQUESTED', '', NULL, 'Diplodocus', 'diplodocus@longtail.org', '1000000028', 'Complains that swinging his tail at supersonic speeds creates booming sounds that reverberate across valleys. Says echoes return several seconds later, confusing him into thinking rival herds are calling when it is just his own tail crack.', '', false, '2025-11-01 10:30:00', '2025-11-01 10:30:00'),
(20, '2025-11-02 18:30:00', 1800, 'REQUESTED', '', NULL, 'Styracosaurus', 'styracosaurus@spikedmail.org', '1000000029', 'Claims low-frequency vibrations from displaying his massive horned frill have led to mild hearing distortion. Notes that echoes of his own dominance calls cause discomfort in group settings, reducing his enthusiasm for mating season rituals.', '', false, '2025-11-01 10:35:00', '2025-11-01 10:35:00');

-- Reset sequence to next available ID
ALTER SEQUENCE AppointmentEntity_seq RESTART WITH 21;
